import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import MainPage from './MainPage';
import EnterPage from './EnterPage';
import LoginPage from './LoginPage';
import RegisterPage from './RegisterPage';
import ProfilePage from './ProfilePage';
import DriverMapPage from './DriverMapPage';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Navigate replace to="/enter" />} />  {/* Redirect from root to EnterPage */}
        <Route path="/main" element={<MainPage />} />  {/* Keep MainPage accessible via /main */}
        <Route path="/enter" element={<EnterPage />} />  {/* Main content displayed on EnterPage */}
        <Route path="/login" element={<LoginPage />} />
        <Route path="/register" element={<RegisterPage />} />
        <Route path="/profile" element={<ProfilePage />} />
        <Route path="/map" element={<DriverMapPage />} />
      </Routes>
    </Router>
  );
}

export default App;
